import React, { Component } from "react";
import Button from "@material-ui/core/Button";
import Artists from "./TextFields/Artists";
import Movements from "./TextFields/Movements";
import Centuries from "./TextFields/Centuries";
import Branches from "./TextFields/Branches";

class Main extends Component {
  render() {
    return (
      <div>
        <Artists />
        <br />
        <Movements />
        <br />
        <Centuries />
        <br />
        <Branches />
        <br />
        <Button variant="contained" color="secondary">
          Submit
        </Button>
      </div>
    );
  }
}

export default Main;
